    )
}
const mapStateToProps = (state) => {
    return{
        tdArray: state.toDoArray
    }
}

const mapDispatchToProps =(dispatch) => {
    return{
        addMyList: (val) => dispatch({type:'ADD_ITEM' , payload: val}) ,
        findMyItem: (val) => dispatch({type:'FIND_ITEM' , payload: val}) ,
        updateMyList: (val) => dispatch({type:'UPDATE_ITEM' , payload: val}) ,
        deleteMyList: (val) => dispatch({type:'DELETE_ITEM' , payload: val})
        }
}

export default connect(mapStateToProps,mapDispatchToProps)(SearchToDoList)
